import React, { useEffect, useState } from 'react';
import { connect, useDispatch } from 'react-redux';
import axios from 'axios';
import { setCategoryList } from '../redux/actions/productActions';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import { Typography, CircularProgress } from '@mui/material';

const CategoryList = (props) => {
  const { categoryList, setCategoryList } = props;
  const categoryId = window.location.pathname.split("/")[2];
  const [category, setCategory] = useState({});
  const dispatch = useDispatch();
  const [isLoading, setIsLoading] = useState(true);

  const fetchCategoryList = async () => {
    try {
      const resp = await axios.get('http://localhost:3001/dietCategories');
      if (resp && resp.status === 200) {
        const decodedCategories = resp.data.map((categoryList) => {
          const base64Image = `data:image/jpeg;base64,${categoryList.categoryImage}`;
          return {
            ...categoryList,
            categoryImage: base64Image
          };
        });
        dispatch(setCategoryList(decodedCategories));
      }
    } catch (error) {
      console.log('Error:', error);
    } finally {
      setIsLoading(false);
    }
  };

  useEffect(() => {
    fetchCategoryList();
  }, []);

  useEffect(() => {
    const getCategoryId = () => {
      categoryList &&
        categoryList.forEach((category) => {
          if (categoryId === category.categoryId) {
            setCategory(category);
            return;
          }
        });
    };

    if (Object.keys(category).length === 0) {
      getCategoryId();
    }
  }, [categoryList, categoryId]);

  return (
    <div>
      <h1>Category Detail</h1>
      {isLoading ? (
        <CircularProgress />
      ) : (
        <Paper elevation={10} style={{ marginTop: "50px", marginBottom: "80px", height: "950px" }}>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={4} style={{ color: "#9c27b0" }}>
              <Typography variant="h4" component="h2" color="secondary" style={{ fontWeight: "bold" }}>
                {category.categoryName}
              </Typography>
              <Typography variant="h4" component="h2" color="secondary" style={{ fontWeight: "bold" }}>
                {category.description}
              </Typography>
              {category.categoryImage && (
                <img
                  src={category.categoryImage}
                  alt="Category"
                  onLoad={() => console.log("Image loaded")}
                  style={{ maxWidth: "100%", height: "auto" }}
                />
              )}
              {category.dailyDietPlan && category.dailyDietPlan.map((plan) => {
                return (
                  <div key={plan.ageRange}>
                    <Typography variant="h6" component="h3" color="secondary" style={{ fontWeight: "bold" }}>
                      {plan.ageRange}
                    </Typography>
                    {plan.programDetails && plan.programDetails.map((detail) => {
                      return (
                        <div key={detail.breakfast}>
                          <Typography variant="body1" component="p" color="secondary" style={{ fontWeight: "bold" }}>
                            Breakfast:
                          </Typography>
                          <Typography variant="body2" component="p">
                            {detail.breakfast}
                          </Typography>
                          <Typography variant="body1" component="p" color="secondary" style={{ fontWeight: "bold" }}>
                            Lunch:
                          </Typography>
                          <Typography variant="body2" component="p">
                            {detail.lunch}
                          </Typography>
                          <Typography variant="body1" component="p" color="secondary" style={{ fontWeight: "bold" }}>
                            Dinner:
                          </Typography>
                          <Typography variant="body2" component="p">
                            {detail.dinner}
                          </Typography>
                          <Typography variant="body1" component="p" color="secondary" style={{ fontWeight: "bold" }}>
                            Snack:
                          </Typography>
                          <Typography variant="body2" component="p">
                            {detail.snack}
                          </Typography>
                          <Typography variant="body1" component="p" color="secondary" style={{ fontWeight: "bold" }}>
                            Amount of Water:
                          </Typography>
                          <Typography variant="body2" component="p">
                            {detail.amountofWater}
                          </Typography>
                        </div>
                      );
                    })}
                  </div>
                );
              })}
            </Grid>
          </Grid>
        </Paper>
      )}
    </div>
  );
};

const mapStateToProps = (state) => ({
  categoryList: state.categoryList.categoryList,
});

const mapDispatchToProps = {
  setCategoryList,
};

export default connect(mapStateToProps, mapDispatchToProps)(CategoryList);
